import React from "react";
import '../Css/contact.css';
import { FaMapMarkerAlt,FaAt ,FiPhoneCall} from "react-icons/fa";

const Contact = () => {
    return (
      <>
      <div className="Contact" >
           <div className="Cont_Info">
             <div><FaMapMarkerAlt/>Address City, Country</div>
             <div><FaAt/>Himanshu.shivam61@gmail.com</div>
             <div><FiPhoneCall/>9870949800</div>
             <div><FaMapMarkerAlt/>Mon-Sat 8:00 AM to 5:00 PM</div>


           </div>
        </div>
      
      </>
    );
  }
  
  export default Contact;
